   box-shadow: 0 1px 3px rgba(15, 15, 15, 0.13);
   display: flex;
   align-items: center;
   padding: 0 1.5em;

`;

const LeftSection = styled.div`
   display flex;
`;

const MiddleSection = styled.div`
   display: flex;
   flex: 2;
   height: 100;
  justify-content: center;
`;

const RightSection = styled.div`
    display: flex;
`;

export function Navbar(props) {
    return (
    <NavbarContainer>
      <LeftSection>
        <Logo/>
      </LeftSection>
    <MiddleSection>

    </MiddleSection>
    <RightSection>

    </RightSection>
    </NavbarContainer>
    )
}
